window.bookSummaryJSON = "<p><b>She's always been his safe place to land.</b></p> <p>Jensen has shared a special bond with Tuck for as long as she can remember, their friendship a language that never needed words. But as life threw her one curveball after another, that secret language turned to stony silence.</p> <p><b>He's always been her protector.</b></p> <p>Tuck has looked out for Jensen since the day she was born. As his best friend's little sister, he's tried to keep her firmly in the family category. But she's always been more.</p> <p>All it takes is one moment of weakness to send Tuck's fiercely guarded walls crumbling to the ground. As a new fire burns between them, someone watches. Someone who doesn't like the new life Jensen's building for herself.</p> <p>And they'll stop at nothing to keep her in the dark.</p>"; 
